import React, {useState} from 'react';
import { Button } from '@material-ui/core';

function Munchkin(){

  const [display, toggleDisplay] = useState('hidden');

  return(
    <div>
      <span>
        <b>WARNING: </b> Only the cutest of munchkins can click this button
        without perishing! Use at your own risk!
      </span>
      <div>
        <Button>
          Click Me
        </Button>
      </div>
    <div style={{overflow: display}}>
      I love my little itty bitty munchkin baby
    </div>
    </div>
  )
}

export default Munchkin;
